urdb_response.description:
Mandatory:
(1) To Customers who were billed under Rate II as of February 20, 2012;
(2) To any Customer, other than Customers taking service under Rider J, whose monthly maximum demand
exceeds 1,500 kWin any annual period ending September 30;
(3) To any new Customer, other than a new Customer taking service under Rider J, whose monthly maximum
demand in the Company's estimate will exceed 1,500 kWduring the first year of service;
(4) To successors of Customers referred to in (1), (2) and (3) above; and
(5) To any Customer taking service under Rider J, whose monthly maximum demand exceeds 900 kW in any
annual period ending September 30, or in the case of a new Customer taking service under Rider J, whose
monthly maximum demand in the Company's estimate will exceed 900 kWduring the first year of service;
